// src/components/Header.jsx
import React from 'react';
import { Link } from 'react-router-dom';

const Header = ({ user, logout }) => {
  return (


    <header class="bg-gradient-to-r from-purple-700 to-blue-600 text-white shadow-lg">
      <div class="container mx-auto px-6 py-4 flex justify-between items-center">
        <div class="flex items-center space-x-4">
          <img src="https://img.icons8.com/external-smashingstocks-detailed-outline-smashing-stocks/64/ffffff/external-book-bookstore-smashingstocks-detailed-outline-smashing-stocks.png" alt="Logo" class="h-10 w-10"/>
          <h1 class="text-3xl font-bold">Book Exchange</h1>
        </div>
        <nav class="hidden md:flex space-x-8">
          <a href="#" class="text-white hover:bg-white hover:text-purple-700 px-4 py-2 rounded transition-all duration-300 ease-in-out shadow-md">Home</a>
          <a href="#" class="text-white hover:bg-white hover:text-purple-700 px-4 py-2 rounded transition-all duration-300 ease-in-out shadow-md">Browse Books</a>
          <a href="#" class="text-white hover:bg-white hover:text-purple-700 px-4 py-2 rounded transition-all duration-300 ease-in-out shadow-md">About Us</a>
          <a href="#" class="text-white hover:bg-white hover:text-purple-700 px-4 py-2 rounded transition-all duration-300 ease-in-out shadow-md">Contact Us</a>
          <a href="#" class="bg-purple-600 hover:bg-white hover:text-purple-600 px-6 py-2 rounded-full shadow-lg font-semibold transition duration-300 transform hover:scale-110">Logout</a>
        </nav>
        <button class="md:hidden text-white focus:outline-none">
          <svg xmlns="http://www.w3.org/2000/svg" class="h-8 w-8" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M4 6h16M4 12h16m-7 6h7" />
          </svg>
        </button>
      </div>
    </header>


  );
};

export default Header;
